import '../css/dungeons.css';

export default function DungeonsComp(){
    return(
    <div className="dungeons">

        <h1>Dungeons</h1>
        <div className="locations">
            <DungeonCard
            name="Broken Halls"
            bossOne="Minator"
            bossTwo="Gorgon"
            mobs="stafrushers..."
            />
        </div>
    </div>

    )
}
